              <LearningMetricForm />
            </Card>
          </Col>

          <Col xs={10} sm={10} xl={14}>  
            <Card id="map" title = {t('Map Select & Overview')} padding="1.25rem">
              <MapControlForm />
            </Card>
          </Col>
          <Col id="server-accuracy" xs={10} xxl={12}>
            <ServerAccuracy />
          </Col>
          <Col id="client-accuracy" xs={10} xxl={12}>
